import React from 'react';
import './FaceRecognition.css';


const FaceRecognition =({imageUrl})=>{
	return(
		<div className="Imge shadow-5 pa2">
			<img src={imageUrl} alt="photo"/>
		</div>
	)
}

export default FaceRecognition;
